            address: '[::]'
            port: 3553
        upstream:
            address: 127.0.0.1
            port: 53
        disableRemap53: false
        disableFakePTR: false
        disableDropAAAA: false
        maxIdleConns: 10
        maxConcurrent: 100
        timeout: 5000
